import React from "react";
import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import Mainpage from "./components/Mainpage/Mainpage";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Mainpage />
        <Navbar />
        <Switch>
          <Route path="/Home">
            <About />
          </Route>
          <Route path="/Chat">
            <About />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/about">
            <About />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
